import React from 'react';
import ReactDOM from 'react-dom';

class MainContent extends React.Component () {
    render() {
        <div>
            <h1><Welcome /> {this.props.name}!</h1>
        </div>
    }
}



ReactDOM.render(<App />, document.getElementById('root'));
